export default function(){
    return [
        {
            id: 1,
            due: 'no due date',
            text: 'belajar react',
            status: 'N'
        },
        {
            id: 2,
            due: 'no due date',
            text: 'belajar redux',
            status: 'Y'
        },
        {
            id: 3,
            due: 'april 1st',
            text: 'belajar maleo',
            status: 'N'
        }
    ]
}
